import React from "react";

function Bag() {
  return (
    <div className="productBlock">
      <img width="65" src="./images/img1.jpg" alt="" />
      <div className="productContent">
        <div className="productTitle-price"></div>
        <div className="productSize-removeBtn"></div>
      </div>
    </div>
  )
}

export default Bag;
